import React, { Component } from 'react';

class MainLayout extends Component {

  constructor(props) {
    super(props);
    this.state = {
      click: false,
    };
  }

  render() {
    return (
      <div className="mainlayout">
        hey {this.state.click && 'clicked'}
      </div>
    );
  }
}

export default MainLayout;
